function filterInputPK10(input, searchLength) {
  const separators = /[ ,|]+/; // Regex to match space, comma, or pipe separator
  const numbers = input
    .split(separators)
    .filter((item) => item.length == searchLength);

  const seenTriplets = new Set();

  for (const element of numbers) {
    if (checkUniquePairs(element)) {
      seenTriplets.add(element);
    }
  }

  console.log(seenTriplets.size);
  console.log(Array.from(seenTriplets));
  return Array.from(seenTriplets).join(",");
}

