function checkUniquePairs(str) {
  let pairs = {};

  for (let i = 0; i < str.length - 1; i += 2) {
    let pair = str.substring(i, i + 2);
    // console.log(pair);
    if (Number(pair) > 10) return;
    if (!pairs[pair]) {
      // console.log("pair", pairs)
      pairs[pair] = 0;
    }
    pairs[pair]++;
  }

  for (let pair in pairs) {
    if (pairs[pair] > 1) {
      return false;
    }
  }

  return true;
}


